import "./Day.css"; 
import Notification from "./Day"; 
import Calendar from "../Calendar/Calendar"; 

function Day(props) {

    if(props.date == null) return; 


    let isToday = (Math.abs(props.date.getTime() - Date.now()) < 30); 

    function getDayClass() {
        if(props.date.getMonth() != Calendar.currMonth ) return "hidden"; 
        else if(isToday) return "today"; 
        return "current"; 
    }

    // boolean to check if certain Date object represents current day




    return (
        <div id="date_box" className={getDayClass()}>
            <Notification notifs = {0} id="notification"> </Notification>
            <p id="month"></p>
            <p id="day">{props.date.getDate()}</p>
        </div>
        //Add JSX Code
    );
}

export default Day;
